script: |
  super -f text -I q11617.spq | sort > q11617.out

inputs:
  - name: q11617.spq
    data: |
      SELECT + ( + 21 ) FROM tab0 (FORMAT parquet) WHERE + col0 NOT BETWEEN col2 AND CAST ( + CAST ( NULL AS REAL ) AS REAL );
  - name: tab0

outputs:
  - name: q11617.out
    data: |
      21
      21
